            className={`${styles[item.style]} tracking-wide`}
            style={{
              opacity: hoveredId === item.id ? 1 : 0.6,
              transition: hoveredId === item.id ? 'opacity 1.2s ease-out 0.6s' : 'opacity 0.3s ease-out'
            }}
